    Main: {
        backgroundColor: '#F56962'
    },

    forback:{
        display:'flex',

    },
    subMain:{
        padding:'20px'
    }
}))

function SideBar() {
    const classes = useStyles();
    return (
        <div className={classes.Main}>
            <div className={classes.subMain}>
                <div className = {forback}>
                <img src = {BackIcon}/>
                    <p className = {classes.para}>Back</p>
                </div>
                
            </div>
        </div>
    )
}

export default SideBar
